import './PokeAbilities.css'

const PokeAbilities = (abilities) => {
    return (
    <div className='text2'>
        <p>Abilities</p>
        {abilities && abilities.map((el) => {
                    return (
                    <p className='number' key={el.ability.name}>{`${el.ability.name}`} </p>
                    )
                })}
    </div>
    )
}

export default PokeAbilities
